import Chat from './components/Chat.js';

function App() {
  return (
    <div className="App">
      <Chat />
      <iframe title="chat-embeded"
        src="https://www.twitch.tv/embed/s0mcs/chat?parent=localhost"
        height="700px"
        width="350px">
      </iframe>
    </div>
  );
}

export default App;
